/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "week-3---a-algorithm"
    }}>{`Week 3 - A`}{`*`}{` Algorithm`}</h1>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#week-3---a-algorithm"
        }}>{`Week 3 - A`}{`*`}{` Algorithm`}</a>{`
- `}<a parentName="li" {...{
          "href": "#a-search"
        }}>{`A`}{`*`}{` Search`}</a>{`
- `}<a parentName="li" {...{
          "href": "#admissible-heauristic"
        }}>{`Admissible Heauristic`}</a>{`
- `}<a parentName="li" {...{
          "href": "#optimality-of-a---proof"
        }}>{`Optimality of A`}{`*`}{` - Proof`}</a>{`
- `}<a parentName="li" {...{
          "href": "#dominance"
        }}>{`Dominance`}</a></li>
    </ul>
    <p><strong parentName="p">{`Aims`}</strong></p>
    <ul>
      <li parentName="ul">{`A`}{`*`}{` search algorithm`}</li>
      <li parentName="ul">{`How to invent admissible heuristics`}</li>
    </ul>
    <h2 {...{
      "id": "a-search"
    }}>{`A`}{`*`}{` Search`}</h2>
    <ul>
      <li parentName="ul">{`UCS minimizes the cost so far `}<inlineCode parentName="li">{`g(n)`}</inlineCode></li>
      <li parentName="ul">{`GS minimizes the estimated cost to the goal `}<inlineCode parentName="li">{`h(n)`}</inlineCode></li>
      <li parentName="ul">{`A`}{`*`}{` combining UCS and GS`}</li>
      <li parentName="ul">{`Evaluation function: `}<inlineCode parentName="li">{`f(n)=g(n)+h(n)`}</inlineCode>{` - `}<inlineCode parentName="li">{`g(n) = cost so far to reach n`}</inlineCode>{` - `}<inlineCode parentName="li">{`h(n) = est. cost from n to goal`}</inlineCode>{` - `}<inlineCode parentName="li">{`f(n) = est. total cost of path through n to the goal`}</inlineCode></li>
    </ul>
    <p>{`The idea is that we take into account both the cost and estimated cost and combine them to decide which nodes to add to the fringe queue!`}</p>
    <p><strong parentName="p">{`BFS and UCS Special Case`}</strong></p>
    <ul>
      <li parentName="ul">{`BFS is a special case of A`}{`*`}{` when f(n)=depth(n)`}</li>
      <li parentName="ul">{`BFS is also a special case of UCS when g(n)=depth(n)`}</li>
      <li parentName="ul">{`UCS is a special case of A`}{`*`}{` when h(n)=0`}</li>
    </ul>
    <h2 {...{
      "id": "admissible-heauristic"
    }}>{`Admissible Heauristic`}</h2>
    <ul>
      <li parentName="ul">{`Heuristic `}<inlineCode parentName="li">{`h(n)`}</inlineCode>{` is admissible if for every node n: - `}<inlineCode parentName="li">{`h(n) <= h*(n)`}</inlineCode>{` where `}<inlineCode parentName="li">{`h*(n)`}</inlineCode>{` is the true cost to reach a goal from `}<inlineCode parentName="li">{`n`}</inlineCode>{` - The estimate to reach the goal is smaller or equal to the true cost to reach the goal`}</li>
      <li parentName="ul">{`Admissible heuristics are `}<inlineCode parentName="li">{`optimistic`}</inlineCode>{` - they think that the cost of solving the problem is less than it actually is. - heuristic never overestimates actual cost -> it is admissible`}</li>
    </ul>
    <p><strong parentName="p">{`Theorem`}</strong></p>
    <p>{`If `}<inlineCode parentName="p">{`h`}</inlineCode>{` is an `}<inlineCode parentName="p">{`admissible heuristic`}</inlineCode>{` than A`}{`*`}{` is complete and optimal.`}</p>
    <p>{`How to check?`}</p>
    <p>{`See if the estimated cost for a node is <= the actual cost from that node to the goal node.`}</p>
    <h2 {...{
      "id": "optimality-of-a---proof"
    }}>{`Optimality of A`}{`*`}{` - Proof`}</h2>
    <p>{`Compare f(G2) and f(G)`}</p>
    <ol>
      <li parentName="ol">{`f(G2)=g(G2)+h(G2) (by definition) = g(G2) as h(G2)=0, G2 is a goal`}</li>
      <li parentName="ol">{`f(G)=g(G)+h(G) (by definition) = g(G) as h(G)=0, G is a goal`}</li>
      <li parentName="ol">{`g(G2)>g(G) as G2 is suboptimal`}</li>
      <li parentName="ol">{`=> f(G2)>f(G) by substituting 1) and 2) into 3)`}</li>
      <li parentName="ol">{`f(n)=g(n)+h(n) (by definition)`}</li>
      <li parentName="ol">{`h(n) <= h`}<em parentName="li">{`(n) where h`}</em>{`(n) is the true cost from n to G (as h is admissible)`}</li>
      <li parentName="ol">{`=> f(n)<=g(n) + h`}{`*`}{`(n) (5 & 6)`}</li>
      <li parentName="ol">{`= g(G) path cost from S to G via n`}</li>
      <li parentName="ol">{`g(G) = f(G) as f(G)=g(G)+h(G)=g(G)+0 as h(G)=0, G is a goal`}</li>
      <li parentName="ol">{`=> f(n)<=f(G) (7,8,9)`}<ul parentName="li">
          <li parentName="ul">{`Thus f(G)<f(G2) (4) & f(n)<=f(G) (10)`}</li>
        </ul></li>
      <li parentName="ol">{`f(n)<=f(G)<f(G2) (10, 4)`}</li>
      <li parentName="ol">{`f(n)<f(G2) => n will be expanded not G2; A`}{`*`}{` will not select G2 for expansion`}</li>
    </ol>
    <h2 {...{
      "id": "dominance"
    }}>{`Dominance`}</h2>
    <p>{`Two admissibleheuristics h(1) and h(2)`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`h[2]`}</inlineCode>{` dominates `}<inlineCode parentName="li">{`h[1]`}</inlineCode>{` if for all nodes `}<inlineCode parentName="li">{`n`}</inlineCode>{` we have `}<inlineCode parentName="li">{`h[2](n) >= h[1](n)`}</inlineCode></li>
    </ul>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
